import { useState } from 'react'

export default function useGameSettings() {
    const [settings, setSettings] = useState({
        'level': 0,
        'row': 0,
        'col': 0,
        'proportion': 0,
        'mine': 0,
        'setTime': {
            isTime: true,
            duration: 600

        }
    })

    return {settings, setSettings};
}
